val aPattern = "(\\d+)[NSns](\\W?)(\\d+)[Ww]" 

val x1 = counts1.filter( s => s._1.matches(aPattern) && s._2 > 1)
val x2 = x1.map( s => {
    if ("[N]".r.findFirstIn(s._1) != None){
        (s._1.replaceAll("[^\\p{L}\\p{Nd}]+", "").toUpperCase.split("N")(0)+", -"+s._1.replaceAll("[^\\p{L}\\p{Nd}]+", "").toUpperCase.split("N")(1).split("W")(0)+", "+ s._2.toString)
    }else{
        ("-"+s._1.replaceAll("[^\\p{L}\\p{Nd}]+", "").toUpperCase.split("S")(0)+", -"+s._1.replaceAll("[^\\p{L}\\p{Nd}]+", "").toUpperCase.split("S")(1).split("W")(0)+", "+ s._2.toString)
    }
})
x2.saveAsTextFile("hdfs://localhost:9000/workshop_s3/101/csvFile")
